import React from "react";
import { Link } from "react-router-dom";
import "../Navbar/Navbar.css";

import Logo from "../../assets/logo.svg";
import Home from "../../assets/icon-nav-home.svg";
import Movies from "../../assets/icon-nav-movies.svg";
import TVSeries from "../../assets/icon-nav-tv-series.svg";
import Bookmark from "../../assets/icon-nav-bookmark.svg";
import User from "../../assets/image-avatar.png";

const Navbar = () => {
  return (
    <nav className="navbar-container">
      <img className="nav-logo" src={Logo} alt="logo" />
      <ul className="nav-links">
        <Link to="/">
          <li>
            <img className="nav-link" src={Home} alt="home logo" />
          </li>
        </Link>
        <li>
          <img className="nav-link" src={Movies} alt="movies logo" />
        </li>
        <li>
          <img className="nav-link" src={TVSeries} alt="tv series logo" />
        </li>
        <li>
          <img className="nav-link" src={Bookmark} alt="bookmark logo" />
        </li>
      </ul>
      <img className="user-img" src={User} alt="user" />
    </nav>
  );
};

export default Navbar;
